    const AddExpenseHandler = () => {
      setExpenses(expenses);
    }

    return(
        <div className="MainPageMainContainer">
            <div className="main">
            <Left/>
            <Right/>
            </div>
            <hr />
            <Help item={expenses}/>
        </div>
    )
}
export default Main;
